import React from 'react'
import { View, StyleSheet } from 'react-native'

import colors from '../config/colors'

const WelcomeScreen = () => {
  return <View style={styles.container}></View>
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: 'red',
    flex: 1,
  },
})

export default WelcomeScreen
